import "./styles/index.scss";

export const FilmList = () => {
    return (
        <div className="film-list">
            <FilmItem name='Sherlock Holmes' desc='London, 1890 Five ritual murders have been committed in the city, and another <br />
            one is about to happen. But the great detective Sherlock Holmes and his faithful <br />
            friend and assistant Dr. Watson manage to prevent the crime.' image='https://static.hdrezka.ac/i/2013/7/30/ib112bef22285rd76q76o.jpg' />
